import React from "react";
import Card from "./Card";

export default function DynamicContent() {
  const cardData = [
    {  image: "./images/_af49ea8e-1cfe-491f-b568-6888c48f7f93.jpeg", star: "./images/star.png", name: "Product 1", description: "Description 1", price: "$19.99" },
    { id: 2, image: "./images/_af49ea8e-1cfe-491f-b568-6888c48f7f93.jpeg", star: "./images/star.png", name: "Product 2", description: "Description 2", price: "$29.99" },
    { id: 3, image: "./images/_af49ea8e-1cfe-491f-b568-6888c48f7f93.jpeg", star: "./images/star.png", name: "Product 1", description: "Description 1", price: "$19.99" },
    { id: 4, image: "./images/_af49ea8e-1cfe-491f-b568-6888c48f7f93.jpeg", star: "./images/star.png", name: "Product 2", description: "Description 2", price: "$29.99" },
    { id: 5, image: "./images/_af49ea8e-1cfe-491f-b568-6888c48f7f93.jpeg", star: "./images/star.png", name: "Product 1", description: "Description 1", price: "$19.99" },
    { id: 6, image: "./images/_af49ea8e-1cfe-491f-b568-6888c48f7f93.jpeg", star: "./images/star.png", name: "Product 2", description: "Description 2", price: "$29.99" },
    // Add more card data as needed
  ];

  return (
    <section className="dynamic-content">
      {cardData.map((card) => (
        <Card
          id={card.id}
          image={card.image}
          star={card.star}
          name={card.name}
          description={card.description}
          price={card.price}
        />
      ))}
    </section>
  );
}
